import React from 'react';
import styled from 'styled-components';
import Container from "react-bootstrap/Container";
import {Col, Row} from "react-bootstrap";

const ContainerParent = styled.div`
  background-color: white;
`;

const ContainerStyled = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 100px;
  background-color: whitesmoke;
`;

const Partition = styled.div`
  padding: 20px;
`
const LeftContent = styled.div`
  flex: 0.25;
  width: 30%;
  height: 100%;
`;

const ImageBox = styled.img`
  flex: 1;
  border-radius: 50px;
  width: 300px;
  height: 300px;
`

const RightContent = styled.div`
  flex: 1;
  text-align: left;
  width: 100%;
  flex-direction: column;
`;

const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 20px;
`;

const Button = styled.button`
  display: inline-block;
  padding: 0.65em 1.6em;
  border: 3px solid #ffffff;
  margin: 0 0.3em 0.3em 0;
  border-radius: 0.12em;
  box-sizing: border-box;
  text-decoration: none;
  font-family: "Roboto", sans-serif;
  font-weight: 300;
  color: #ffffff;
  text-align: center;
  transition: all 0.2s;
  animation: bn13bouncy 5s infinite linear;
  position: relative;
`;

const Introduction_Title = styled.p`
  font-size: 32px;
`;

const Introduction = styled.p`
  font-size: 16px;
`;
const Home = () => {
    return (
        <ContainerParent>
            <ContainerStyled>
                <LeftContent>
                    <ImageBox src="/profile.jpeg"/>
                </LeftContent>
                <RightContent>
                    <Introduction_Title>
                        My Name is Subin
                    </Introduction_Title>
                    <Introduction>
                        안녕하세요, 저는 클라이언트 개발자이며, 그래픽과 웹 프론트엔드에 큰 관심을 가지고 있는 사람입니다. 웹 디자인과 사용자 경험을 개선하는 데 열정을 가지고 있습니다.
                    </Introduction>
                </RightContent>
            </ContainerStyled>
            <ButtonContainer>
                <Container>
                    <Row>
                        <Col>
                            <Button>버튼 1</Button>
                        </Col>
                        <Col>
                            <Button>버튼 2</Button>
                        </Col>
                    </Row>
                    <Partition></Partition>
                    <Row>
                        <Col>
                            <Button>버튼 3</Button>
                        </Col>
                        <Col>
                            <Button>버튼 4</Button>
                        </Col>
                    </Row>
                </Container>
            </ButtonContainer>
        </ContainerParent>

    )
};

export default Home;
